import React, { useState, useEffect } from 'react'
import { Link, useNavigate, useLocation, useParams, json } from 'react-router-dom'
import { Form, Row, Col, Button, check } from 'react-bootstrap'
import { useDispatch, useSelector } from 'react-redux'
import Loader from '../components/Loader'
import Message from '../components/Message'
import FormContainer from '../components/FormContainer'
import { USER_UPDATE_RESET } from '../constants/userConstants'

import { listProductDetails } from '../actions/productActions'
import { PRODUCT_DETAILS_REQUEST } from '../constants/productConstants'

function ProductEditScreen() {

  const productId = useParams()['id']

  const [name, setName] = useState('')
  const [price, setPrice] = useState(0)
  const [image, setImage] = useState('')
  const [category, setCategory] = useState('')
  const [brand, setBrand] = useState('')
  const [countInStock, setCountInStock] = useState(0)
  const [description, setDescription] = useState(0)

  const dispatch = useDispatch()
  const navigate = useNavigate()

  const productDetails = useSelector(state => state.productDetails)
  const { error, loading, product } = productDetails
  
  const userUpdate = useSelector(state => state.userUpdate)
  const { error: errorUpdate, loading: loadingUpdate, success: successUpdate } = userUpdate

  useEffect(() => {
//     if(successUpdate){
//         dispatch({type: PRODUCT_DETAILS_REQUEST })
//         navigate('/admin/productlist')
//     } else {
    if (!product.name || product._id !== Number(productId)){
    dispatch(listProductDetails(productId))
    }
    else {
        setName(product.name)
        setPrice(product.price)
        setImage(product.image)
        setCategory(product.category)
        setBrand(product.brand)
        setCountInStock(product.countInStock)
        setDescription(product.description)
        console.log(JSON.stringify(product))
    }
    
    
  }, [productId, product, dispatch, navigate])

  const submitHandler = (e) => {
    e.preventDefault()
    console.log('Update product')
  }
    return (
        <div>
            <Link to='/admin/productlist'>Go Back</Link>
            <FormContainer>
                <h1>Edit User</h1>
                {loading && <Loader/>}
                {error && <Message variant='danger'>{error}</Message>}

                {loading ? <Loader /> : error ? <Message variant='danger'>{error}</Message> 
                : (
                    <Form onSubmit={submitHandler}>
                    <Form.Group controlId='name' className='mb-3'>
                        <Form.Label>Name</Form.Label>
                        <Form.Control 
                            // required
                            type='name' 
                            placeholder='Enter name' 
                            value={name} 
                            onChange={(e) => setName(e.target.value)}>
                        </Form.Control>
                    </Form.Group>

                    <Form.Group controlId='price' className='mb-3'>
                        <Form.Label>Price</Form.Label>
                        <Form.Control 
                        // required
                        type='price' 
                        placeholder='Enter price' 
                        value={price} 
                        onChange={(e) => setPrice(e.target.value)}>
                        </Form.Control>
                    </Form.Group>
                    
                    {/* <Form.Group controlId='image' className='mb-3'>
                        <Form.Label>Image</Form.Label>
                        <Form.Check 
                            // required
                            type='checkbox' 
                            label='Is Admin'
                            checked={isAdmin}
                            onChange={(e) => setIsAdmin(e.target.checked)}>
                        </Form.Check>
                    </Form.Group> */}

                    <Form.Group controlId='category' className='mb-3'>
                        <Form.Label>category</Form.Label>
                        <Form.Control 
                        // required
                        type='category' 
                        placeholder='Enter category' 
                        value={category} 
                        onChange={(e) => setCategory(e.target.value)}>
                        </Form.Control>
                    </Form.Group>

                    <Form.Group controlId='brand' className='mb-3'>
                        <Form.Label>brand</Form.Label>
                        <Form.Control 
                        // required
                        type='brand' 
                        placeholder='Enter brand' 
                        value={brand} 
                        onChange={(e) => setBrand(e.target.value)}>
                        </Form.Control>
                    </Form.Group>

                    <Form.Group controlId='countInStock' className='mb-3'>
                        <Form.Label>countInStock</Form.Label>
                        <Form.Control 
                        // required
                        type='integer' 
                        placeholder='Enter stock' 
                        value={countInStock} 
                        onChange={(e) => setCountInStock(e.target.value)}>
                        </Form.Control>
                    </Form.Group>

                    <Form.Group controlId='description' className='mb-3'>
                        <Form.Label>description</Form.Label>
                        <Form.Control 
                        // required
                        type='description' 
                        placeholder='Enter description' 
                        value={description} 
                        onChange={(e) => setDescription(e.target.value)}>
                        </Form.Control>
                    </Form.Group>
            
                    <Button type='submit' variant='primary'>Update</Button>
                    </Form>
                )}
            </FormContainer>
        </div>
    )
}

export default ProductEditScreen
